import { Navbar, Typography, IconButton, Button, Input } from "@material-tailwind/react";
import { BellIcon, Cog6ToothIcon } from "@heroicons/react/24/solid";
   
export function NavbarDark() {

    return (
        <Navbar className="mx-auto max-w-screen-xl bg-blue-gray-900 text-black px-4 py-3"> {/* Set background color and text color */}
        <div className="flex flex-wrap items-center justify-between gap-y-4">
          <Typography
            as="a"
            href="#"
            variant="h6"
            className="mr-4 ml-2 cursor-pointer py-1.5"
          >
            Material Tailwind
          </Typography>
          <div className="ml-auto flex gap-1 md:mr-4">
            <IconButton variant="text" color="white"> {/* Set icon color to white */}
              <Cog6ToothIcon className="h-4 w-4" />
            </IconButton>
            <IconButton variant="text" color="white"> {/* Set icon color to white */}
              <BellIcon className="h-4 w-4" />
            </IconButton>
          </div>
          <div className="relative flex w-full gap-2 md:w-max">
            <Input
              type="search"
              label="Type here..."
              className="pr-20"
              containerProps={{
                className: "min-w-[288px]",
              }}
            />
            <Button size="sm" className="!absolute right-1 top-1 rounded">
              Search
            </Button>
          </div>
        </div>
        
      </Navbar>
    );
  }
